import React, { useState } from 'react';
import applestore from './icon/applestore.png';
import setting from './icon/setting.png';
import contact from './icon/contact.png';
import imsg from './icon/imessage.png';
import facetime from './icon/facetime.png';
import applemusic from './icon/applemusic.png';
import pinterest from './icon/pinterest.png';
import launchpad from './icon/launchedpad.png';
import finder from './icon/finder.png.jpeg';
import bin from './icon/bin.png';
import './Dock.css';
import Launchpad from './Launchpad';

export default function Dock() {
  const [value, setValue] = useState(false);
  const [anime,setAnime] = useState('fade-out');
  function launch() {
    setValue((prevValue) => !prevValue);
    if(anime=='fade-out'){
      setAnime('fade=in')
    }
    if(anime=='fade-in'){
      setAnime('fade-out')
    }
  }

  function renderlaunch() {
    return (
        <div id='lp' className={`lp${anime}`}>
          <Launchpad />
        </div>
    );
  }

  return (
    <>
      {value && renderlaunch()}
      <div className='dock'>
        <div className="apps">
          <a><img src={finder} alt="" className="finder" /></a>
          <a><img onClick={launch} src={launchpad} alt="" className="launchpad" /></a>
          <a><img src={pinterest} alt="" className="pinterest" /></a>
          <a><img src={imsg} alt="" className="imsg" /></a>
          <a><img src={applemusic} alt="" className="applemusic" /></a>
          <a><img src={facetime} alt="" className="facetime" /></a>
          <a><img src={contact} alt="" className="contact" /></a>
          <a><img className='store' src={applestore} /></a>
          <a><img src={setting} alt="" className="sett" /></a>
          <a><img src={bin} alt="" className="bin" /></a>
        </div>
      </div>
    </>
  );
}
